import React from 'react'
import "./Footer.css"
import IpsumLogo from '../Images/IpsumLogo.svg'
export default function Footer() {
  return (
    <div  className='footer'>
        <img src={IpsumLogo} alt='img.png' className='Ipsumimg'></img>
        <div className='Contact'>
          <h3>Contact Us</h3>
        </div>
    </div>
  )
}
